pragma solidity ^0.4.11;

import '../core/event/MultiEventsHistoryAdapter.sol';

contract ExchangeManagerEmitter is MultiEventsHistoryAdapter {
    event ExchangeCreated(
        address indexed self,
        address indexed user,
        address exchange,
        address asset);
    event ExchangeAdded(address indexed self, address indexed user, address exchange, address asset);
    event ExchangeRemoved(address indexed self, address exchange, address asset);
    event Error(address indexed self, uint errorCode);

    function emitExchangeCreated(address user, address exchange, address asset) public {
        ExchangeCreated(_self(), user, exchange, asset);
    }

    function emitExchangeRemoved(address exchange, address asset) public {
        ExchangeRemoved(_self(), exchange, asset);
    }

    function emitExchangeAdded(address user, address exchange, address asset) public {
        ExchangeAdded(_self(), user, exchange, asset);
    }

    function emitError(uint errorCode) public {
        Error(_self(), errorCode);
    }
}
